⚠️⚠️⚠️ *COMPARTILHE AO MÁXIMO!*⚠️⚠️⚠️


Os únicos lugares que a galera tem que ir daqui pra frente são:

1) pras bases de combustível e refinarias;

2) pra Brasília, chegando até o dia 08/01 (se for depois, simplesmente NÃO VAI CONSEGUIR CHEGAR pois *A PARTIR DE 09/01/2023 A RODAGEM VAI PARAR TODO O BRASIL!* );

3) pras estradas/rodovias nas beiras de suas respectivas cidades, trancando em frente a algum posto de combustíveis que funcione 24h, pra ter ponto de apoio permanente ao longo dos dias/semanas do nosso ato;

4) Pras Assembléias Legislativas de seus Estados, no caso de quem mora nas Capitais dos Estados.

(Ramiro dos Caminhoneiros - 04/01/2023)

